	},
	{
		name: 'Jennifer Goran',
		birthmonth: 'July',
		birthday: 4,
		birthyear: 1992,
		image: require('./Jennifer.jpeg'),
	},
	{
		name: 'Peter Miller',
		birthmonth: 'April',
		birthday: 16,
		birthyear: 1978,
		image: require('./Peter.jpeg'),
	},
	{
		name: 'Shannon Jenkins',
		birthmonth: 'August',
		birthday: 28,
